import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const Netflix = () => {
  return (
    <>
      <h1 className="heading-style">List of TOP Most Webseries in Netflix</h1>
      {Sdata.map((val, id) => {
        return (
          <Card
            imgsrc={val.id.imgsrc}
            title={val.id.title}
            sname={val.id.sname}
            links={val.id.links}
          />
        );
      })}
    </>
  );
};

export default Netflix;
